import { StyleSheet } from "react-native";

const style = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    title: {
      fontSize: 20,
      fontWeight: 'bold',
      marginVertical: 20,
    },
    label: {
      fontSize: 16,
      fontWeight: 'bold',
      marginVertical: 10,
    },
    textInput: {
      borderWidth: 1,
      borderColor: '#ccc',
      padding: 5,
      marginVertical: 10,
      width: '100%',
    },
    button: {
      marginVertical: 10,
    },
    text: {
      color: 'white',
    },
    genderButton: {
      flexDirection: 'row',
      alignItems: 'center',
      marginVertical: 5,
    },
  });

export default {style};
